<h2>Elements of a deque</h2>
<html>
 <head></head>
 <body>
  <p>Which elements will <code class="language-java">deq</code> contain after executing the following code?</p> 
  <p>The order is important.</p> 
  <pre><code class="language-java">Deque&lt;Integer&gt; deq = new LinkedList&lt;&gt;();

for (int i = 10; i &gt;= 0; i--) {
    deq.offerLast(i);
}

deq.pollFirst();
deq.pollFirst();
deq.pollLast();</code></pre>
 </body>
